import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import ToDo from './ToDo_list';
import {BrowseRoute} from 'react-router-dom';

ReactDOM.render(
  <BrowseRoute>
  <ToDo />
  </BrowseRoute>,
  document.getElementById('root')
);
